import React from 'react';
import {
    Switch,
    Route,
  } from 'react-router-dom';

  import MainPage from '../pages/MainPage';

  const routes: React.FC = () => (
  <Switch>
      <Route path="/" exact component={MainPage}></Route>
  </Switch>    
  );

  export default routes;
